import React from 'react';
import './FilmStripEdges.css';

const FilmStripEdges = () => {
  // Sample images array - replace these with your own
  const pictures = [
    { src: '/images/pic1.jpg', alt: 'Memorable moment 1' },
    { src: '/images/pic2.jpg', alt: 'Memorable moment 2' },
    { src: '/images/pic3.jpg', alt: 'Memorable moment 3' },
    // ... add more pictures as needed
  ];

  return (
    <>
      {/* Left Strip */}
      <div className="film-edge film-edge-left">
        {pictures.map((pic, idx) => (
          <div className="film-frame" key={`left-${idx}`}>
            <img src={pic.src} alt={pic.alt} />
          </div>
        ))}
      </div>

      {/* Right Strip */}
      <div className="film-edge film-edge-right">
        {pictures.map((pic, idx) => (
          <div className="film-frame" key={`right-${idx}`}>
            <img src={pic.src} alt={pic.alt} />
          </div>
        ))}
      </div>
    </>
  );
};

export default FilmStripEdges;
